import React from 'react';
import { VictoryPie } from 'victory'
import {View} from 'react-native'
  const data=[
        { x: "Cats", y: 35 },
        { x: "Dogs", y: 40 },
        { x: "Birds", y: 55 },
      ]
export default function ProfolioPie() {

  return (
    <View><VictoryPie data={data}/></View>
  );
}
